//test if two divs are near enough to join when we compare div1's left+width to div2's left
function leftnear(div1,div2){
  
  if(div1.attributes["data-canvas-width"]!=null){
    var left1=parseInt(div1.style.left);
    var width1=parseInt(div1.attributes["data-canvas-width"].nodeValue);
    var left2=parseInt(div2.style.left);
    var right=left1+width1;
    var diff=Math.abs(right-left2)
    var near=4;
    if(diff<=near)
      return true;
    else
      return false;    
  }
  return true;
}
//test if two tops are near each other and we can assume they are effectively the same top value
function topnear(top1,top2){
  var near=4;
  top1=parseFloat(top1);
  top2=parseFloat(top2);
  if(top1==top2)
    return true;
  else{

    var diff=Math.abs(top2-top1);
    if(diff<=near){
      return true;
    }
  }
  return false;
}
